import React, { Component } from 'react';

// TODO: refactor the code using useState
export default class Create extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      time: '',
      zoom: '',
      purpose: '',
    };
  }
  onChangeUsername(e) {
    this.setState({
      name: e.target.value,
    });
  }
  onChangeTime(e) {
    this.setState({
      time: e.target.value,
    });
  }
  onChangeZoom(e) {
    this.setState({
      zoom: e.target.value,
    });
  }
  onChangePurpose(e) {
    this.setState({
      purpose: e.target.value,
    });
  }
  onSubmit(e) {
    const form = {
      name: this.state.name,
      time: this.state.time,
      zoom: this.state.zoom,
      purpose: this.state.purpose,
    };
  }
  render() {
    return <div>This is create page</div>;
  }
}
